import React, { useEffect, useState } from 'react';
import axios from 'axios';

const InventorySummaryPage = () => {
  const [items, setItems] = useState([]);
  const [search, setSearch] = useState('');

  useEffect(() => {
    fetchInventory();
  }, []);

  const fetchInventory = async () => {
    try {
      const res = await axios.get('http://localhost:5050/api/inventory/all');
      setItems(res.data);
    } catch (err) {
      console.error('Error fetching inventory:', err);
    }
  };

  const groupByRack = () => {
    const grouped = {};
    items.forEach((item) => {
      const rackLetter = item.location?.[0]?.toUpperCase() || 'Unknown';
      if (!grouped[rackLetter]) grouped[rackLetter] = [];
      grouped[rackLetter].push(item);
    });
    return grouped;
  };

  const groupedItems = groupByRack();

  const filteredItems = Object.entries(groupedItems).reduce((acc, [rack, itemList]) => {
    const filtered = itemList.filter(item =>
      item.name.toLowerCase().includes(search.toLowerCase()) ||
      item.description?.toLowerCase().includes(search.toLowerCase()) ||
      item.location?.toLowerCase().includes(search.toLowerCase())
    );
    if (filtered.length > 0) acc[rack] = filtered;
    return acc;
  }, {});

  const rackColors = {
    A: '#e8f5e9', B: '#e3f2fd', C: '#fff3e0', D: '#fce4ec', E: '#ede7f6',
    F: '#e0f2f1', G: '#f9fbe7', H: '#f3e5f5', I: '#e1f5fe', Unknown: '#eeeeee'
  };

  const handleExport = () => {
    const csvContent = [
      ['Rack', 'Item', 'Description', 'Location', 'Quantity'],
      ...items.map(i => [i.location?.[0]?.toUpperCase() || 'Unknown', i.name, i.description, i.location, i.quantity])
    ].map(e => e.join(",")).join("\n");
    const blob = new Blob([csvContent], { type: 'text/csv' });
    const url = URL.createObjectURL(blob);
    const link = document.createElement('a');
    link.href = url;
    link.download = 'inventory_summary.csv';
    link.click();
  };

  return (
    <div style={styles.container}>
      <h2>ðŸ“¦ Inventory Summary by Rack</h2>

      <div style={styles.controls}>
        <input
          type="text"
          placeholder="ðŸ” Search by item, location or description..."
          value={search}
          onChange={(e) => setSearch(e.target.value)}
          style={styles.searchBar}
        />
        <button onClick={handleExport} style={styles.exportBtn}>â¬‡ Export CSV</button>
      </div>

      {Object.keys(filteredItems).sort().map((rack) => (
        <div
          key={rack}
          style={{ ...styles.rackSection, backgroundColor: rackColors[rack] || '#fff' }}
        >
          <h3 style={styles.rackTitle}>Rack {rack}</h3>
          <table style={styles.table}>
            <thead>
              <tr>
                <th>Item</th>
                <th>Description</th>
                <th>Location</th>
                <th>Quantity</th>
              </tr>
            </thead>
            <tbody>
              {filteredItems[rack].map((item) => (
                <tr key={item._id}>
                  <td>{item.name}</td>
                  <td>{item.description || 'â€”'}</td>
                  <td>{item.location}</td>
                  <td>{item.quantity}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      ))}
    </div>
  );
};

const styles = {
  container: {
    padding: '30px',
    fontFamily: 'Arial, sans-serif',
    background: 'linear-gradient(to right, #e0f7fa, #fdfdfd)',
    minHeight: '100vh'
  },
  rackSection: {
    marginBottom: '40px',
    padding: '15px',
    borderRadius: '10px',
    boxShadow: '0 0 8px rgba(0,0,0,0.08)'
  },
  rackTitle: {
    marginBottom: '10px',
    color: '#333'
  },
  table: {
    width: '100%',
    borderCollapse: 'collapse',
    backgroundColor: '#fff'
  },
  controls: {
    marginBottom: '20px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center'
  },
  searchBar: {
    padding: '10px',
    fontSize: '14px',
    width: '70%',
    borderRadius: '6px',
    border: '1px solid #ccc'
  },
  exportBtn: {
    padding: '10px 16px',
    backgroundColor: '#1976d2',
    color: '#fff',
    border: 'none',
    borderRadius: '6px',
    cursor: 'pointer'
  }
};

export default InventorySummaryPage;
